import React from 'react';





function App() {
    const mystle={
        flexdirection: "column",
        justifyContent: "flex-start",
        width:"45%",
        backgroundColor:"white",
        textAlign:"center",
        margin:"128px auto",
        borderRadius:"8px",
        paddingBottom:"40%"

    };
    const headstyle={
        backgroundColor:"lightblue"
    }
    return ( 
        <div  style={mystle}>
            <div style={headstyle}>
                <h1>hello</h1>
            </div>

        </div>






    );
}

export default App;
